    const Navigate = useNavigate();
    const [localToken, storeToken] = useLocalStorage('token');
    const [localUser,storeUser] = useLocalStorage('user');
    setCurrentUser();
    setToken();
    JoblyApi.token = '';
    console.log(localToken,localUser)
    storeToken(undefined);
    storeUser(undefined);


    return Navigate('/');
}

export default Logout;
